INSERT INTO `ps_cms_lang` VALUES (12,1,1,'O nas','','','','','o-nas'),(12,2,1,'O nas','','','','<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\">Firma EUROPOL – właściciel marki STUDIO KLAMEK - od ponad 20 lat specjalizuje się w sprzedaży okuć drzwiowych, okiennych i meblowych.</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\">STUDIO KLAMEK – według opinii Klientów, najlepsze na rynku studio obsługujące klientów indywidualnych, biura architektoniczne, zakłady stolarskie i salony drzwiowe w zakresie klamek drzwiowych, okiennych oraz uchwytów meblowych.</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"><img src=\"http://localhost:8080/img/cms/klamka.jpg\" alt=\"\" width=\"529\" height=\"227\" style=\"font-family:Verdana, Arial, Helvetica, sans-serif;font-size:11px;\" /></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">Jesteśmy importerem światowej renomy producentów:</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    ENRICO CASSINA - www.enricocassina.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    OMP PORRO - www.omporro.eu</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    FORMANI - www.formani.com</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    OLIVARI - www.olivari.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    COLOMBO - www.colombodesign.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    GLASS DESIGN - www.ariushome.it, www.glassdesign.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    MESTRE - www.broncesmestre.com</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    PAMAR - www.pamar.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    MARIANI - www.mariani.biz, www.grarivadossi.com</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    BECCHETTI BAL - www.bechettibal.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    DIDHEYA - www.didheya.es</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    SALICE PAOLO - www.salicepaolo.it</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">    TUPAI - www.tupai.pl</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\">Stawiamy na zadowolenie klienta poprzez profesjonalizm w obsłudze. Oferowany przez nas towar jest zawsze wysokiej jakości i najczęściej dostępny \"od ręki\".</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:left;\"><span style=\"text-align:justify;\">ZAPRASZAMY!!!</span></p>','o-nas'),(13,1,1,'Dane firmy','','','','','dane-firmy'),(13,2,1,'Dane firmy','','','','<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\">Ewa Szymańczyk Europol Prywatna Firma Handlowa</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\">ul. Bartycka 24/26 pawilon 17</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\">00-716 Warszawa</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\">NIP 5211651553</p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\">BDO 000106413</p>','dane-firmy'),(14,1,1,'Kontakt z nami','','','','','kontakt-z-nami'),(14,2,1,'Kontakt z nami','','','','','kontakt-z-nami'),(15,1,1,'Dostawa','','','','','dostawa'),(15,2,1,'Dostawa','','','','<p class=\"MsoNormal\" style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';\">Czas dostawy = czas przygotowania zamówienia do wysyłki, po zaksięgowaniu wpłaty na koncie + czas transportu.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';\">1 .Czas przygotowania zamówienia do wysłania to standardowo 1-2 dni robocze, jeśli towar jest dostępny w magazynie.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:center;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';\">2. Zamówienia, które zostały złożone do godziny 10.00 z opcją wysyłki kurierem mogą być wysłane tego samego dnia z dostawą na kolejny dzień roboczy, jeśli mamy towar w magazynie.</span></p>','dostawa'),(16,1,1,'Płatności','','','','','platnosci'),(16,2,1,'Płatności','','','','<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">Szanowni Państwo,</p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">W iklamki<span style=\"font-weight:bolder;\">.pl</span> możecie wybrać spośród następujących opcji płatności:</p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">1. Płatność <span style=\"font-weight:bolder;\">przelewem</span> <span style=\"font-weight:bolder;\">na</span> <span style=\"font-weight:bolder;\">konto</span></p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">Ewa Szymańczyk Europol Prywatna Firma Handlowa<br />ul. Bartycka 24/26 pawilon 17<br />00-716 Warszawa</p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">Numer rachunku bankowego: 55 1750 0009 0000 0000 1117 0207</p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">2. Płatność za pośrednictwem serwisu <span style=\"font-weight:bolder;\"><span class=\"caps\">PAYU</span>.PL</span>.</p>\n<p style=\"margin:0px auto 16px;font-size:14px;color:#40485d;max-width:900px;line-height:1.625;background-color:#ffffff;font-family:Helvetica, Arial, sans-serif;text-align:left;\">Jest ona realizowana przez sprawdzony i bezpieczny system <a href=\"http://www.payu.pl/\" style=\"background-color:transparent;color:#ee2e24;\"><span style=\"font-weight:bolder;\">PAYU</span></a>. W serwisie tym można dokonać szybkiej płatności przelewem z większości polskich banków, jak również kartą kredytową.</p>','platnosci'),(17,1,1,'Polityka prywatności','','','','','polityka-prywatnosci'),(17,2,1,'Polityka prywatności','','','','<p><img src=\"http://localhost:8080/img/cms/cert.png\" alt=\"\" width=\"657\" height=\"290\" /></p>\n<h2 style=\"text-align:center;\">POLITYKA PRYWATNOŚCI</h2>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Niniejsza Polityka Prywatności określa zasady przetwarzania danych osobowych pozyskanych za pośrednictwem sklepu internetowego </span><a href=\"http://localhost:8080\" target=\"_blank\" style=\"background-color:#ffffff;color:#ee2e24;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;\" rel=\"noreferrer noopener\">iklamki.pl</a><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"> (zwanego dalej: „</span><span style=\"font-weight:bolder;color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Sklepem Internetowym</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">”).</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Właścicielem Sklepu Internetowego i jednocześnie administratorem danych jest Ewa Szymańczyk prowadząca działalność gospodarczą pod firmą Ewa Szymańczyk \" EUROPOL\" PRYWATNA FIRMA HANDLOWA z siedzibą w Warszawie (00-716), ul. Bartycka 24/26 pawilon 17, wpisana do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez Ministra Rozwoju, Pracy i Technologii, NIP: 5211651553, REGON: 012300112, zwana dalej\"EUROPOL\".</span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Dane osobowe zbierane przez \"EUROPOL\" za pośrednictwem Sklepu Internetowego są przetwarzane zgodnie z Rozporządzeniem Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych), zwane również <span style=\"font-weight:bolder;\">RODO</span>.</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">\"EUROPOL\" dokłada szczególnej staranności do poszanowania prywatności Klientów odwiedzających Sklep Internetowy.</span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">\"EUROPOL\" dokłada szczególnej staranności do poszanowania prywatności Klientów odwiedzających Sklep Internetowy. </span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"></span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"><span style=\"font-weight:bold;text-align:center;\">§ 1 Rodzaj przetwarzanych danych, cele oraz podstawa prawna</span></span></p>\n<ol>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">\"EUROPOL\" zbiera informacje dotyczące osób fizycznych dokonujących czynności prawnej niezwiązanej bezpośrednio z ich działalnością, osób fizycznych prowadzących we własnym imieniu działalność gospodarczą lub zawodową oraz osób fizycznych reprezentujących osoby prawne lub jednostki organizacyjne niebędące osobami prawnymi, którym ustawa przyznaje zdolność prawną, zwanych dalej łącznie Klientami.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Dane osobowe Klientów są zbierane w przypadku:</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">rejestracji konta w Sklepie Internetowym, w celu utworzenia indywidualnego konta i zarządzania tym kontem. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy o świadczenie usługi Konta (art. 6 ust. 1 lit. b RODO);</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">składania zamówienia w Sklepie Internetowym, w celu wykonania umowy sprzedaży. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy sprzedaży (art. 6 ust. 1 lit. b RODO);</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">subskrypcji biuletynu informacyjnego (Newsletter), w celu wykonania umowy, której przedmiotem jest usługa świadczona drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - zgoda osoby, której dane dotyczą na wykonanie umowy o świadczenie usługi Newsletter (art. 6 ust. 1 lit. a RODO);</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">korzystania z usługi formularza kontaktowego w Sklepie Internetowym w celu wykonania umowy świadczonej drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy o świadczenie usługi formularza kontaktowego (art. 6 ust. 1 lit. b RODO);</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">korzystania z usługi zapytaj o produkt, w celu wykonania umowy, której przedmiotem jest usługa świadczona drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy o świadczenie usługi zapytaj o produkt (art. 6 ust. 1 lit. b RODO).</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku rejestracji konta w Sklepie Internetowym, Klient podaje:</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">adres e-mail;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">imię i nazwisko.</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Podczas rejestracji konta w Sklepie Internetowym Klient samodzielnie ustala indywidualne hasło dostępu do swojego konta. Klient może zmienić hasło, w późniejszym czasie, na zasadach opisanych w §5.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku składania zamówienia w Sklepie Internetowym, Klient podaje następujące dane:</span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">adres e-mail;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">dane adresowe:</span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">kod pocztowy i miejscowość;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">kraj (państwo);</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">ulica wraz z numerem domu/mieszkania.</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">imię i nazwisko;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">numer telefonu.</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku Przedsiębiorców, powyższy zakres danych jest dodatkowo poszerzony o:<br /><br /></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">firmę Przedsiębiorcy;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">numer NIP.</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku skorzystania z usługi Newsletter, Klient podaje jedynie swój adres e-mail.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku skorzystania z usługi formularza kontaktowego, Klient podaje jedynie swój adres e-mail.</span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">imię i nazwisko.</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W przypadku skorzystania z z usługi zapytaj o produkt, Klient podaje:</span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">adres e-mail;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">imię i nazwisko;</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">numer telefonu (nieobowiązkowo).</span></li>\n</ol>\n</li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Podczas korzystania ze Strony Internetowej Sklepu mogą być pobierane dodatkowe informacje, w szczególności: adres IP przypisany do komputera Klienta lub zewnętrzny adres IP dostawcy Internetu, nazwa domeny, rodzaj przeglądarki, czas dostępu, typ systemu operacyjnego.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Od Klientów mogą być także gromadzone dane nawigacyjne, w tym informacje o linkach i odnośnikach, w które zdecydują się kliknąć lub innych czynnościach, podejmowanych w Sklepie Internetowym. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - prawnie uzasadniony interes (art. 6 ust. 1 lit. f RODO), polegający na ułatwieniu korzystania z usług świadczonych drogą elektroniczną oraz na poprawie funkcjonalności tych usług.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">W celu ustalania, dochodzenia i egzekucji roszczeń mogą być przetwarzane niektóre dane osobowe podane przez Klienta w ramach korzystania z funkcjonalności w Sklepie Internetowym takie jak: imię, nazwisko, dane dotyczące korzystania z usług, jeżeli roszczenia wynikają ze sposobu, w jaki Klient korzysta z usług, inne dane niezbędne do udowodnienia istnienia roszczenia, w tym rozmiarów poniesionej szkody. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - prawnie uzasadniony interes (art. 6 ust. 1 lit. f RODO), polegający na ustaleniu, dochodzeniu i egzekucji roszczeń oraz na obronie przed roszczeniami w postępowaniu przed sądami i innymi organami państwowymi.</span></li>\n<li><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\">Przekazanie danych osobowych do \"EUROPOL\" jest dobrowolne, w związku z zawieranymi umowami sprzedaży, czy też świadczenia usług za pośrednictwem Strony Internetowej Sklepu, z tym jednak zastrzeżeniem, że niepodanie określonych w formularzach danych w procesie Rejestracji uniemożliwia Rejestrację i założenie Konta Klienta, zaś w przypadku składania zamówienia bez Rejestracji Konta Klienta uniemożliwi złożenie i realizację zamówienia Klienta.</span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\">§ 2 Komu udostępniane lub powierzane są dane oraz jak długo są przechowywane?</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;text-align:justify;background-color:#ffffff;\"></span></p>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Dane osobowe Klienta przekazywane są dostawcom usług, z których korzysta \"EUROPOL\" przy prowadzeniu Sklepu Internetowego. Dostawcy usług, którym przekazywane są dane osobowe, w zależności od uzgodnień umownych i okoliczności, albo podlegają poleceniom \"EUROPOL\" co do celów i sposobów przetwarzania tych danych (podmioty przetwarzające) albo samodzielnie określają cele i sposoby ich przetwarzania (administratorzy).</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Podmioty przetwarzające</span>. \"EUROPOL\" korzysta z dostawców, którzy przetwarzają dane osobowe wyłącznie na polecenie \"EUROPOL\". Należą do nich m.in. dostawcy świadczący usługę hostingu, usługi księgowe, dostarczający systemy do marketingu, systemy do analizy ruchu w Sklepie Internetowym, systemy do analizy skuteczności kampanii marketingowych;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Administratorzy</span>. \"EUROPOL\" korzysta z dostawców, którzy nie działają wyłącznie na polecenie i sami ustalają cele i sposoby wykorzystania danych osobowych Klientów. Świadczą oni usługi płatności elektronicznych oraz bankowe.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Lokalizacja</span>. Dostawcy usług mają siedziby w Polsce i w innych krajach Europejskiego Obszaru Gospodarczego (EOG).</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Dane osobowe Klientów przechowywane są:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku, gdy podstawą przetwarzania danych osobowych jest zgoda wówczas dane osobowe Klienta przetwarzane są przez \"EUROPOL\" tak długo, aż zgoda nie zostanie odwołana, a po odwołaniu zgody przez okres czasu odpowiadający okresowi przedawnienia roszczeń jakie może podnosić \"EUROPOL\" i jakie mogą być podnoszone wobec niego. Jeżeli przepis szczególny nie stanowi inaczej, termin przedawnienia wynosi lat sześć, a dla roszczeń o świadczenia okresowe oraz roszczeń związanych z prowadzeniem działalności gospodarczej - trzy lata.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku, gdy podstawą przetwarzania danych jest wykonanie umowy, wówczas dane osobowe Klienta przetwarzane są przez \"EUROPOL\" tak długo, jak jest to niezbędne do wykonania umowy, a po tym czasie przez okres odpowiadający okresowi przedawnienia roszczeń. Jeżeli przepis szczególny nie stanowi inaczej, termin przedawnienia wynosi lat sześć, a dla roszczeń o świadczenia okresowe oraz roszczeń związanych z prowadzeniem działalności gospodarczej - trzy lata.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku dokonania zakupu w Sklepie Internetowym dane osobowe mogą być przekazywane firmie kurierskiej, w celu dostarczenia zamówionych towarów.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku, gdy Klient wybierze płatność poprzez system PayU, jego dane osobowe są przekazywane w zakresie niezbędnym dla realizacji płatności spółce PayU S.A. z siedzibą w Poznaniu (60-166), przy ul. Grunwaldzkiej 182, wpisanej do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy Poznań - Nowe Miasto i Wilda w Poznaniu, Wydział VIII Gospodarczy Krajowego Rejestru Sądowego pod numerem KRS 0000274399.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Dane nawigacyjne mogą być wykorzystywane w celu zapewnienia Klientom lepszej obsługi, analizy danych statystycznych i dostosowania Sklepu Internetowego do preferencji Klientów, a także administrowania Sklepem Internetowym.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku, gdy Klient dokona subskrypcji biuletynu informacyjnego (Newsletter) na jego adres e-mail \"EUROPOL\" będzie wysyłać wiadomości elektroniczne zawierające informacje handlowe o promocjach i nowych produktach dostępnych w Sklepie Internetowym.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku skierowania żądania \"EUROPOL\" udostępnia dane osobowe uprawnionym organom państwowym, w szczególności jednostkom organizacyjnym Prokuratury, Policji, Prezesowi Urzędu Ochrony Danych Osobowych, Prezesowi Urzędu Ochrony Konkurencji i Konsumentów lub Prezesowi Urzędu Komunikacji Elektronicznej.</span></span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\">§ 3 Mechanizm cookies, adres IP</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;text-align:center;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"></span></span></p>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Sklep Internetowy używa niewielkich plików, zwanych cookies. Zapisywane są one przez \"EUROPOL\" na urządzeniu końcowym osoby odwiedzającej Sklep Internetowy, jeżeli przeglądarka internetowa na to pozwala. Plik cookie zwykle zawiera nazwę domeny, z której pochodzi, swój „czas wygaśnięcia\" oraz indywidualną, losowo wybraną liczbę identyfikującą ten plik. Informacje zbierane za pomocą plików tego typu pomagają dostosowywać oferowane przez \"EUROPOL\" produkty do indywidualnych preferencji i rzeczywistych potrzeb osób odwiedzających Sklep Internetowy. Dają też możliwość opracowywania ogólnych statystyk odwiedzin prezentowanych produktów w Sklepie Internetowym.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" wykorzystuje dwa typy plików cookies:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Cookies sesyjne</span>: po zakończeniu sesji danej przeglądarki lub wyłączeniu komputera zapisane informacje są usuwane z pamięci urządzenia. Mechanizm cookies sesyjnych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z komputerów Klientów.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Cookies trwałe</span>: są przechowywane w pamięci urządzenia końcowego Klienta i pozostają tam do momentu ich skasowania lub wygaśnięcia. Mechanizm cookies trwałych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z komputera Klientów.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" wykorzystuje cookies własne w celu:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">uwierzytelniania Klienta w Sklepie Internetowym i zapewnienia sesji Klienta w Sklepie Internetowym (po zalogowaniu), dzięki której Klient nie musi na każdej podstronie Sklepu Internetowego ponownie wpisywać loginu i hasła;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">analiz i badań oraz audytu oglądalności, a w szczególności do tworzenia anonimowych statystyk, które pomagają zrozumieć, w jaki sposób Klienci korzystają ze Strony Internetowej Sklepu, co umożliwia ulepszanie jej struktury i zawartości.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" wykorzystuje cookies zewnętrzne w celu:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">prezentowania na stronach informacyjnych Sklepu, mapy wskazującej lokalizację biura \"EUROPOL\", za pomocą serwisu internetowego maps.google.com (administrator cookies zewnętrznego: Google Inc z siedzibą w USA);</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">prezentacji Certyfikatu Rzetelny Regulamin za pośrednictwem serwisu internetowego rzetelnyregulamin.pl (administrator cookies zewnętrznego: Rzetelna Grupa sp. z o.o. z siedzibą w Warszawie).</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Mechanizm cookies jest bezpieczny dla komputerów Klientów Sklepu Internetowego. W szczególności tą drogą nie jest możliwe przedostanie się do komputerów Klientów wirusów lub innego niechcianego oprogramowania lub oprogramowania złośliwego. Niemniej w swoich przeglądarkach Klienci mają możliwość ograniczenia lub wyłączenia dostępu plików cookies do komputerów. W przypadku skorzystania z tej opcji korzystanie ze Sklepu Internetowego będzie możliwe, poza funkcjami, które ze swojej natury wymagają plików cookies.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Poniżej przedstawiamy jak można zmienić ustawienia popularnych przeglądarek internetowych w zakresie stosowania plików cookies:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"https://support.microsoft.com/pl-pl/kb/278835\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Internet Explorer</a>;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"https://privacy.microsoft.com/pl-PL/windows-10-microsoft-edge-and-privacy\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Microsoft EDGE</a>;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"http://support.mozilla.org/pl/kb/ciasteczka\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Mozilla Firefox</a>;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Chrome</a>;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"https://support.apple.com/pl-pl/HT201265\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Safari</a>;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">przeglądarka <a href=\"http://help.opera.com/Linux/9.22/pl/cookies.html\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"color:#ee2e24;\">Opera</a>.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" może gromadzić adresy IP Klientów. Adres IP to numer przydzielany komputerowi osoby odwiedzającej Sklep Internetowy przez dostawcę usług internetowych. Numer IP umożliwia dostęp do Internetu. W większości przypadków jest przypisywany komputerowi dynamicznie, tj. zmienia się przy każdym połączeniu z Internetem. Adres IP jest wykorzystywany przez \"EUROPOL\" przy diagnozowaniu problemów technicznych z serwerem, tworzeniu analiz statystycznych (np. określeniu, z jakich regionów notujemy najwięcej odwiedzin), jako informacja przydatna przy administrowaniu i udoskonalaniu Sklepu Internetowego, a także w celach bezpieczeństwa oraz ewentualnej identyfikacji obciążających serwer, niepożądanych automatycznych programów do przeglądania treści Sklepu Internetowego.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Sklep Internetowy zawiera linki i odnośniki do innych stron internetowych. \"EUROPOL\" nie ponosi odpowiedzialności za zasady ochrony prywatności na nich obowiązujące.</span></span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\">§ 4 Prawa osób, których dane dotyczą</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"></span></span></p>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:bolder;text-align:justify;\">Prawo do cofnięcia zgody</span><span style=\"font-weight:400;text-align:justify;\"> - podstawa prawna: art. 7 ust. 3 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo do cofnięcia każdej zgody, jakiej udzielił \"EUROPOL\".</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Cofnięcie zgody ma skutek od momentu wycofania zgody.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Cofnięcie zgody nie wpływa na przetwarzanie dokonywane przez \"EUROPOL\" zgodnie z prawem przed jej cofnięciem.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Cofnięcie zgody nie pociąga za sobą dla Klienta żadnych negatywnych konsekwencji, może jednak uniemożliwić dalsze korzystanie z usług lub funkcjonalności, które zgodnie z prawem \"EUROPOL\" może świadczyć jedynie za zgodą.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo do sprzeciwu wobec przetwarzania danych</span> - podstawa prawna: art. 21 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo w dowolnym momencie wnieść sprzeciw - z przyczyn związanych z jego szczególną sytuacją - wobec przetwarzania jego danych osobowych, w tym profilowania, jeżeli \"EUROPOL\" przetwarza jego dane w oparciu o prawnie uzasadniony interes, np. marketing produktów i usług \"EUROPOL\", prowadzenie statystyki korzystania z poszczególnych funkcjonalności Sklepu Internetowego oraz ułatwienie korzystania ze Sklepu Internetowego, a także badanie satysfakcji.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Rezygnacja w formie wiadomości e-mail z otrzymywania komunikatów marketingowych dotyczących produktów lub usług, będzie oznaczać sprzeciw Klienta na przetwarzanie jego danych osobowych, w tym profilowania w tych celach.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Jeżeli sprzeciw Klienta okaże się zasadny i \"EUROPOL\" nie będzie miał innej podstawy prawnej do przetwarzania danych osobowych, dane osobowe Klienta zostaną usunięte, wobec przetwarzania których, Klient wniósł sprzeciw.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo do usunięcia danych („prawo do bycia zapomnianym”)</span> - podstawa prawna: art. 17 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo do żądania usunięcia wszystkich lub niektórych danych osobowych.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo żądania usunięcia danych osobowych, jeżeli:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">dane osobowe nie są już niezbędne do celów, w których zostały zebrane lub w których były przetwarzane;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">wycofał określoną zgodę, w zakresie w jakim dane osobowe były przetwarzane w oparciu o jego zgodę;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">wniósł sprzeciw wobec wykorzystywania jego danych w celach marketingowych;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">dane osobowe są przetwarzane niezgodnie z prawem;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">dane osobowe muszą zostać usunięte w celu wywiązania się z obowiązku prawnego przewidzianego w prawie Unii lub prawie Państwa członkowskiego, któremu \"EUROPOL\" podlega;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">dane osobowe zostały zebrane w związku z oferowaniem usług społeczeństwa informacyjnego.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Pomimo żądania usunięcia danych osobowych, w związku z wniesieniem sprzeciwu lub wycofaniem zgody, \"EUROPOL\" może zachować pewne dane osobowe w zakresie, w jakim przetwarzanie jest niezbędne do ustalenia, dochodzenia lub obrony roszczeń, jak również do wywiązania się z prawnego obowiązku wymagającego przetwarzania na mocy prawa Unii lub prawa państwa członkowskiego, któremu podlega \"EUROPOL\". Dotyczy to w szczególności danych osobowych obejmujących: imię, nazwisko, adres e-mail, które to dane zachowywane są dla celów rozpatrywania skarg oraz roszczeń związanych z korzystaniem z usług \"EUROPOL\", czy też dodatkowo adresu zamieszkania/adresu korespondencyjnego, numeru zamówienia, które to dane zachowywane są dla celów rozpatrywania skarg oraz roszczeń związanych z zawartymi umowami sprzedaży lub świadczeniem usług.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo do ograniczenia przetwarzania danych</span> - podstawa prawna: art. 18 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo do żądania ograniczenia przetwarzania jego danych osobowych. Zgłoszenie żądania, do czasu jego rozpatrzenia uniemożliwia korzystanie z określonych funkcjonalności lub usług, z których korzystanie będzie się wiązało z przetwarzaniem danych objętych żądaniem. \"EUROPOL\" nie będzie też wysyłał żadnych komunikatów, w tym marketingowych.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo do żądania ograniczenia wykorzystania danych osobowych w następujących przypadkach:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">gdy kwestionuje prawidłowość swoich danych osobowych – wówczas \"EUROPOL\" ogranicza ich wykorzystanie na czas potrzebny do sprawdzenia prawidłowości danych, nie dłużej jednak niż na 7 dni;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">gdy przetwarzanie danych jest niezgodne z prawem, a zamiast usunięcia danych Klient zażąda ograniczenia ich wykorzystania;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">gdy dane osobowe przestały być niezbędne do celów, w których zostały zebrane lub wykorzystywane ale są one potrzebne Klientowi w celu ustalenia, dochodzenia lub obrony roszczeń;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">gdy wniósł sprzeciw wobec wykorzystania jego danych – wówczas ograniczenie następuje na czas potrzebny do rozważenia, czy – ze względu na szczególną sytuację – ochrona interesów, praw i wolności Klienta przeważa nad interesami, które realizuje Administrator, przetwarzając dane osobowe Klienta.</span></span></li>\n</ol>\n</li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo dostępu do danych</span> - podstawa prawna: art. 15 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo uzyskać od Administratora potwierdzenie, czy przetwarza dane osobowe, a jeżeli ma to miejsce, Klient ma prawo:</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">uzyskać dostęp do swoich danych osobowych;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">uzyskać informacje o celach przetwarzania, kategoriach przetwarzanych danych osobowych, o odbiorcach lub kategoriach odbiorców tych danych, planowanym okresie przechowywania danych Klienta albo o kryteriach ustalania tego okresu (gdy określenie planowanego okresu przetwarzania danych nie jest możliwe), o prawach przysługujących Klientowi na mocy RODO oraz o prawie wniesienia skargi do organu nadzorczego, o źródle tych danych, o zautomatyzowanym podejmowaniu decyzji, w tym o profilowaniu oraz o zabezpieczeniach stosowanych w związku z przekazaniem tych danych poza Unię Europejską;</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">uzyskać kopię swoich danych osobowych.</span></span></li>\n</ol>\n</li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo do sprostowania danych</span> - podstawa prawna: art. 16 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo do żądania od Administratora niezwłocznego sprostowania dotyczących jego danych osobowych, które są nieprawidłowe. Z uwzględnieniem celów przetwarzania, Klient, którego dane dotyczą ma prawo żądania uzupełnienia niekompletnych danych osobowych, w tym przez przedstawienie dodatkowego oświadczenia, kierując prośbę na adres poczty elektronicznej zgodnie z §6 Polityki Prywatności.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"><span style=\"font-weight:bolder;\">Prawo do przenoszenia danych</span> - podstawa prawna: art. 20 RODO.</span></span>\n<ol style=\"list-style-type:lower-alpha;\">\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo otrzymać swoje dane osobowe, które dostarczył Administratorowi, a następnie przesłać je do innego, wybranego przez siebie, administratora danych osobowych. Klient ma również prawo żądać, by dane osobowe zostały przesłane przez Administratora bezpośrednio takiemu administratorowi, o ile jest to technicznie możliwe. W takim przypadku Administrator prześle dane osobowe Klienta w postaci pliku w formacie csv, który jest formatem powszechnie używanym, nadającym się do odczytu maszynowego i pozwalającym na przesłanie otrzymanych danych do innego administratora danych osobowych.</span></span></li>\n</ol>\n</li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W sytuacji wystąpienia przez Klienta z uprawnieniem wynikającym z powyższych praw, \"EUROPOL\" spełnia żądanie albo odmawia jego spełnienia niezwłocznie, nie później jednak niż w ciągu miesiąca po jego otrzymaniu. Jeżeli jednak - z uwagi na skomplikowany charakter żądania lub liczbę żądań – \"EUROPOL\" nie będzie mógł spełnić żądania w ciągu miesiąca, spełni je w ciągu kolejnych dwóch miesięcy informując Klienta uprzednio w terminie miesiąca od otrzymania żądania - o zamierzonym przedłużeniu terminu oraz jego przyczynach.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient może zgłaszać do Administratora skargi, zapytania i wnioski dotyczące przetwarzania jego danych osobowych oraz realizacji przysługujących mu uprawnień.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klient ma prawo żądać od \"EUROPOL\" przekazania kopii standardowych klauzul umownych kierując zapytanie w sposób wskazany w §6 Polityki Prywatności.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Klientowi przysługuje prawo do wniesienia skargi do Prezesa Urzędu Ochrony Danych Osobowych, w zakresie naruszenia jego praw do ochrony danych osobowych lub innych praw przyznanych na mocy RODO.</span></span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\">§ 5 Zarządzanie bezpieczeństwem - hasło</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"></span></span></p>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" zapewnia Klientom bezpieczne i szyfrowane połączenie podczas przesyłania danych osobowych oraz podczas logowania się do Konta Klienta w Serwisie. \"EUROPOL\" stosuje certyfikat SSL wystawiony przez jedną z czołowych światowych firm w zakresie bezpieczeństwa i szyfrowania przesyłanych danych przez sieć Internet.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">W przypadku, gdy Klient posiadający konto w Sklepie Internetowym utracił w jakikolwiek sposób hasło dostępu, Sklep Internetowy umożliwia wygenerowanie nowego hasła. \"EUROPOL\" nie wysyła przypomnienia hasła. Hasło jest przechowywane w formie zaszyfrowanej, w sposób uniemożliwiający jego odczytanie. Celem wygenerowania nowego hasła należy podać adres e-mail w formularzu dostępnym pod linkiem „Nie pamiętasz hasła?”, podanym przy formularzu logowania do konta w Sklepie Internetowym. Klient na adres poczty elektronicznej podany podczas rejestracji lub zapisany w ostatniej zmianie profilu konta otrzyma wiadomość elektroniczną zawierającą przekierowanie do dedykowanego formularza udostępnionego na Stronie Internetowej Sklepu, gdzie Klient będzie miał możliwość ustalenia nowego hasła.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">\"EUROPOL\" nigdy nie wysyła żadnej korespondencji, w tym korespondencji elektronicznej z prośbą o podanie danych do logowania, a w szczególności hasła dostępowego do konta Klienta.</span></span></li>\n</ol>\n<p style=\"text-align:center;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\">§ 6 Zmiany Polityki Prywatności</span><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\"></span></span></p>\n<ol>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Polityka Prywatności może ulec zmianie, o czym \"EUROPOL\" poinformuje Klientów z wyprzedzeniem 7 dni.</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Pytania związane z Polityką Prywatności prosimy kierować na adres: studioklamek@studioklamek.pl</span></span></li>\n<li style=\"text-align:left;\"><span style=\"color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13.3333px;font-weight:bold;background-color:#ffffff;\"><span style=\"font-weight:400;text-align:justify;\">Data ostatniej modyfikacji: 11.12.2020 r.</span></span></li>\n</ol>','polityka-prywatnosci'),(18,1,1,'Regulamin','','','','','regulamin'),(18,2,1,'Regulamin','','','','<table class=\"m-0 spacing-table\" style=\"border-collapse:collapse;background-color:#ffffff;padding:0px 40px 60px;table-layout:auto;color:#232323;font-family:\'Exo 2\', sans-serif;font-size:16px;width:790px;margin:0px;background-image:url(&quot;/img/certyfikat/line-bg.png&quot;);background-position:center bottom;background-size:initial;background-repeat:repeat-x;\">\n<tbody>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 10px;font-size:15pt;width:auto;vertical-align:top;font-weight:bold;\">\n<p style=\"text-align:center;\"><img src=\"http://localhost:8080/img/cms/cert.png\" alt=\"\" width=\"788\" height=\"348\" /></p>\n<p>REGULAMIN SKLEPU INTERNETOWEGO</p>\n</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Niniejszy Regulamin określa ogólne warunki, zasady oraz sposób sprzedaży prowadzonej przez Ewę Szymańczyk prowadzącą działalność gospodarczą pod firmą Ewa Szymańczyk \" EUROPOL\" PRYWATNA FIRMA HANDLOWA z siedzibą w Warszawie, za pośrednictwem sklepu internetowego <a href=\"http://localhost:8080\" target=\"_blank\" style=\"background-color:transparent;color:#ee2e24;\" rel=\"noreferrer noopener\">iklamki.pl</a> (zwanego dalej: „<span style=\"font-weight:bolder;\">Sklepem Internetowym</span>”) oraz określa zasady i warunki świadczenia przez Ewę Szymańczyk prowadzącą działalność gospodarczą pod firmą Ewa Szymańczyk \" EUROPOL\" PRYWATNA FIRMA HANDLOWA z siedzibą w Warszawie usług nieodpłatnych drogą elektroniczną.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 1 Definicje</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Dni robocze</span> - oznacza dni tygodnia od poniedziałku do piątku z wyłączeniem dni ustawowo wolnych od pracy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Dostawa</span> - oznacza czynność faktyczną polegającą na dostarczeniu Klientowi przez Sprzedawcę, za pośrednictwem Dostawcy, Towaru określonego w zamówieniu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Dostawca</span> - oznacza firmę kurierską, z którą współpracuje Sprzedawca w zakresie dokonywania Dostawy Towarów.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Hasło</span> - oznacza ciąg znaków literowych, cyfrowych lub innych wybranych przez Klienta podczas Rejestracji w Sklepie Internetowym, wykorzystywanych w celu zabezpieczenia dostępu do Konta Klienta w Sklepie Internetowym.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Klient</span> - oznacza podmiot, na rzecz którego zgodnie z Regulaminem i przepisami prawa mogą być świadczone usługi drogą elektroniczną lub z którym zawarta może być Umowa sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Konsument</span> - oznacza osobę fizyczną dokonującą z przedsiębiorcą czynności prawnej niezwiązanej bezpośrednio z jej działalnością gospodarczą lub zawodową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Konto Klienta</span> - oznacza indywidualny dla każdego Klienta panel, uruchomiony na jego rzecz przez Sprzedawcę, po dokonaniu przez Klienta Rejestracji i zawarciu umowy świadczenia usługi Prowadzenie Konta Klienta.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Przedsiębiorca</span> - oznacza osobę fizyczną, osobę prawną lub jednostkę organizacyjną niebędącą osobą prawną, której ustawa przyznaje zdolność prawną, prowadzącą we własnym imieniu działalność gospodarczą lub zawodową i dokonującą czynności prawnej związanej bezpośrednio z jej działalnością gospodarczą lub zawodową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Przedsiębiorca z uprawnieniami Konsumenta</span> - oznacza osobę fizyczną zawierającą Umowę sprzedaży bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści Umowy sprzedaży wynika, że nie posiada ona dla tego Przedsiębiorcy zawodowego charakteru, wynikającego w szczególności z przedmiotu wykonywanej przez niego działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Regulamin</span> - oznacza niniejszy regulamin.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">11.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Rejestracja</span> - oznacza czynność faktyczną dokonaną w sposób określony w Regulaminie, wymaganą dla korzystania przez Klienta ze wszystkich funkcjonalności Sklepu Internetowego.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">12.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Sprzedawca</span> - oznacza Ewę Szymańczyk prowadzącą działalność gospodarczą pod firmą Ewa Szymańczyk \" EUROPOL\" PRYWATNA FIRMA HANDLOWA z siedzibą w Warszawie (00-716), ul. Bartycka 24/26 pawilon 17, NIP: 5211651553, REGON: 012300112, wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez Ministra Rozwoju i Technologii; e-mail: studioklamek@studioklamek.pl, będącą jednocześnie właścicielem Sklepu Internetowego.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Numer BDO - 000106413.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">13.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Strona Internetowa Sklepu</span> - oznacza strony internetowe, pod którymi Sprzedawca prowadzi Sklep Internetowy, działające w domenie <a href=\"http://localhost:8080\" target=\"_blank\" style=\"background-color:transparent;color:#ee2e24;\" rel=\"noreferrer noopener\">iklamki.pl</a>.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">14.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Towar</span> - oznacza produkt przedstawiony przez Sprzedawcę za pośrednictwem Strony Internetowej Sklepu, mogący być przedmiotem Umowy sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">15.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Trwałość</span> - zdolność Towaru do zachowania jego funkcji i właściwości w toku zwykłego korzystania.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">16.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Trwały nośnik</span> - oznacza materiał lub narzędzie umożliwiające Klientowi lub Sprzedawcy przechowywanie informacji kierowanych osobiście do niego, w sposób umożliwiający dostęp do informacji w przyszłości przez czas odpowiedni do celów, jakim te informacje służą, i które pozwalają na odtworzenie przechowywanych informacji w niezmienionej postaci.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">17.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\"><span style=\"font-weight:bolder;\">Umowa sprzedaży</span> - oznacza umowę sprzedaży zawartą na odległość, na zasadach określonych w Regulaminie, między Klientem a Sprzedawcą.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 2 Postanowienia ogólne i korzystanie ze Sklepu Internetowego</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Wszelkie prawa do Sklepu Internetowego, w tym majątkowe prawa autorskie, prawa własności intelektualnej do jego nazwy, jego domeny internetowej, Strony Internetowej Sklepu, a także do wzorców, formularzy, logotypów zamieszczanych na Stronie Internetowej Sklepu (z wyjątkiem logotypów i zdjęć prezentowanych na Stronie Internetowej Sklepu w celach prezentacji towarów, do których to prawa autorskie należą do podmiotów trzecich) należą do Sprzedawcy, a korzystanie z nich może następować wyłącznie w sposób określony i zgodny z Regulaminem oraz za zgodą Sprzedawcy wyrażoną na piśmie.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca dołoży starań, aby korzystanie ze Sklepu Internetowego było możliwe dla użytkowników Internetu z użyciem wszystkich popularnych przeglądarek internetowych, systemów operacyjnych, typów urządzeń oraz typów połączeń internetowych. Minimalne wymagania techniczne umożliwiające korzystanie ze Strony Internetowej Sklepu to przeglądarka internetowa w wersji co najmniej Microsoft Edge 109 lub Internet Explorer 11 lub Chrome 110 lub FireFox 109 lub Opera 95 lub Safari 11 lub nowszych, z włączoną obsługą języka Javascript, akceptująca pliki typu „cookies” oraz łącze internetowe o przepustowości co najmniej 256 kbit/s. Strona Internetowa Sklepu jest zoptymalizowana dla minimalnej rozdzielczości ekranu 1024x768 pikseli.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca stosuje mechanizm plików \"cookies\", które podczas korzystania przez Klientów ze Strony Internetowej Sklepu, zapisywane są przez serwer Sprzedawcy na dysku twardym urządzenia końcowego Klienta. Stosowanie plików \"cookies\" ma na celu poprawne działanie Strony Internetowej Sklepu na urządzeniach końcowych Klientów. Mechanizm ten nie niszczy urządzenia końcowego Klienta oraz nie powoduje zmian konfiguracyjnych w urządzeniach końcowych Klientów ani w oprogramowaniu zainstalowanym na tych urządzeniach. Każdy Klient może wyłączyć mechanizm „cookies” w przeglądarce internetowej swojego urządzenia końcowego. Sprzedawca wskazuje, że wyłączenie „cookies” może jednak spowodować utrudnienia lub uniemożliwić korzystanie ze Strony Internetowej Sklepu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W celu złożenia zamówienia w Sklepie Internetowym za pośrednictwem Strony Internetowej Sklepu lub za pośrednictwem poczty elektronicznej oraz w celu korzystania z usług dostępnych na Stronach Internetowych Sklepu, konieczne jest posiadanie przez Klienta aktywnego konta poczty elektronicznej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W celu złożenia zamówienia w Sklepie Internetowym przez telefon, konieczne jest posiadanie przez Klienta aktywnego numeru telefonu oraz aktywnego konta poczty elektronicznej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Zakazane jest dostarczanie przez Klienta treści o charakterze bezprawnym oraz wykorzystywanie przez Klienta Sklepu Internetowego, Strony Internetowej Sklepu lub usług nieodpłatnych świadczonych przez Sprzedawcę, w sposób sprzeczny z prawem, dobrymi obyczajami lub naruszający dobra osobiste osób trzecich.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca oświadcza, iż publiczny charakter sieci Internet i korzystanie z usług świadczonych drogą elektroniczną wiązać może się z zagrożeniem pozyskania i modyfikowania danych Klientów przez osoby nieuprawnione, dlatego Klienci powinni stosować właściwe środki techniczne, które zminimalizują wskazane wyżej zagrożenia. W szczególności powinni stosować programy antywirusowe i chroniące tożsamość korzystających z sieci Internet. Sprzedawca nigdy nie zwraca się do Klienta z prośbą o udostępnienie mu w jakiejkolwiek formie Hasła.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Nie jest dopuszczalne wykorzystywanie zasobów i funkcji Sklepu Internetowego w celu prowadzenia przez Klienta działalności, która naruszałaby interes Sprzedawcy, tj. działalności reklamowej innego przedsiębiorcy lub produktu; działalności polegającej na zamieszczaniu treści niezwiązanych z działalnością Sprzedawcy; działalności polegającej na zamieszczaniu treści nieprawdziwych lub wprowadzających w błąd.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 3 Rejestracja</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W celu utworzenia Konta Klienta, Klient obowiązany jest dokonać nieodpłatnej Rejestracji.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Rejestracja nie jest konieczna do złożenia zamówienia w Sklepie Internetowym.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W celu Rejestracji, Klient powinien wypełnić formularz rejestracyjny udostępniony przez Sprzedawcę na Stronie Internetowej Sklepu i przesłać wypełniony formularz rejestracyjny drogą elektroniczną do Sprzedawcy poprzez wybór odpowiedniej funkcji znajdującej się w formularzu rejestracyjnym. Podczas Rejestracji Klient ustala indywidualne Hasło.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W trakcie wypełniania formularza rejestracyjnego, Klient ma możliwość zapoznania się z Regulaminem, akceptując jego treść poprzez oznaczenie odpowiedniego pola w formularzu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W trakcie Rejestracji Klient może dobrowolnie wyrazić zgodę na przetwarzanie swoich danych osobowych w celach marketingowych poprzez zaznaczenie odpowiedniego pola formularza rejestracyjnego. W takim przypadku Sprzedawca wyraźnie informuje o celu zbierania danych osobowych Klienta, a także o znanych Sprzedawcy lub przewidywanych odbiorcach tych danych.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Wyrażenie przez Klienta zgody na przetwarzanie jego danych osobowych w celach marketingowych nie warunkuje możliwości zawarcia ze Sprzedawcą umowy o świadczenie drogą elektroniczną usługi Prowadzenie Konta Klienta. Zgoda może być w każdej chwili cofnięta, poprzez złożenie Sprzedawcy stosownego oświadczenia Klienta. Oświadczenie może zostać przykładowo przesłane na adres Sprzedawcy za pośrednictwem poczty elektronicznej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Po przesłaniu wypełnionego formularza rejestracyjnego Klient otrzymuje niezwłocznie, drogą elektroniczną na adres poczty elektronicznej podany w formularzu rejestracyjnym potwierdzenie Rejestracji przez Sprzedawcę. Z tą chwilą zawarta zostaje umowa o świadczenie drogą elektroniczną usługi Prowadzenie Konta Klienta, zaś Klient uzyskuje możliwość dostępu do Konta Klienta i dokonywania zmian podanych podczas Rejestracji danych.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 4 Zamówienia</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Informacje zawarte na Stronie Internetowej Sklepu nie stanowią oferty Sprzedawcy w rozumieniu Kodeksu Cywilnego, a jedynie zaproszenie Klientów do składania ofert zawarcia Umowy sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może składać zamówienia w Sklepie Internetowym za pośrednictwem Strony Internetowej Sklepu lub poczty elektronicznej przez 7 dni w tygodniu, 24 godziny na dobę.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może składać zamówienia w Sklepie Internetowym za pośrednictwem telefonu w godzinach i dniach wskazanych na Stronie Internetowej Sklepu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient składający zamówienie za pośrednictwem Strony Internetowej Sklepu, kompletuje zamówienie wybierając Towar, którym jest zainteresowany. Dodanie Towaru do zamówienia następuje przez wybór polecenia \"DO KOSZYKA\" pod danym Towarem prezentowanym na Stronie Internetowej Sklepu. Klient po skompletowaniu całości zamówienia i wskazaniu w „KOSZYKU” sposobu Dostawy oraz formy płatności składa zamówienie przez wysłanie formularza zamówienia do Sprzedawcy, wybierając na Stronie Internetowej Sklepu przycisk „Zamówienie z obowiązkiem zapłaty”. Każdorazowo przed wysyłką zamówienia do Sprzedawcy, Klient jest informowany o łącznej cenie za wybrany Towar i Dostawę, jak też o wszystkich dodatkowych kosztach, jakie jest zobowiązany ponieść w związku z Umową sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient składający zamówienie za pośrednictwem telefonu, wykorzystuje do tego numer telefoniczny podany przez Sprzedawcę na Stronie Internetowej Sklepu. Podczas rozmowy telefonicznej Klient wskazuje Sprzedawcy nazwę Towaru spośród Towarów znajdujących się na Stronie Internetowej Sklepu, ilość Towaru jaką chciałby zamówić oraz określa sposób i adres Dostawy oraz formę płatności, a także wskazuje, wedle wyboru, swój adres poczty elektronicznej albo adres korespondencyjny w celu potwierdzenia przez Sprzedawcę treści proponowanej umowy oraz potwierdzenia zamówienia – w razie gdyby doszło do zawarcia Umowy sprzedaży pomiędzy Klientem, a Sprzedawcą. Każdorazowo podczas rozmowy telefonicznej, Sprzedawca informuje Klienta o cenie łącznej wybranych Towarów oraz łącznym koszcie wybranego sposobu Dostawy, a także o wszystkich dodatkowych kosztach jakie Klient zobowiązany byłby ponieść, gdyby doszło do zawarcia Umowy sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca potwierdza Klientowi treść zaproponowanej Umowy sprzedaży, utrwaloną – według wyboru Klienta - na papierze, bądź w formie wiadomości elektronicznej – przy czym potwierdzenie następuje przed zawarciem Umowy sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Oświadczenie Klienta o zawarciu Umowy sprzedaży, złożone przez niego po otrzymaniu od Sprzedawcy potwierdzenia, o którym mowa powyżej w §4 ust. 6, jest utrwalone na papierze lub innym Trwałym nośniku.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Po zawarciu Umowy sprzedaży za pośrednictwem telefonu, Sprzedawca prześle na Trwałym nośniku, na podany przez Klienta adres poczty elektronicznej lub korespondencyjny informację zawierającą potwierdzenie warunków Umowy sprzedaży. Potwierdzenie zawiera w szczególności: określenie Towaru będącego przedmiotem Umowy sprzedaży, jego cenę, koszt Dostawy i informację o wszelkich innych kosztach jakie Klient zobowiązany jest ponieść w związku z Umową sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient składający zamówienie za pośrednictwem poczty elektronicznej, przesyła je na adres e-mail podany przez Sprzedawcę na Stronie Internetowej Sklepu. Klient w wiadomości przesyłanej do Sprzedawcy, podaje w szczególności: nazwę Towaru, kolor oraz jego ilość, spośród Towarów prezentowanych na Stronie Internetowej Sklepu oraz swoje dane teleadresowe.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Po otrzymaniu od Klienta drogą elektroniczną wiadomości o której mowa w §4 ust. 9, Sprzedawca przesyła Klientowi zwrotną wiadomość za pośrednictwem poczty elektronicznej, podając swoje dane rejestrowe, cenę wybranych Towarów oraz możliwe formy płatności oraz sposób Dostawy wraz z jego kosztem, jak też informacje o wszystkich dodatkowych płatnościach jakie Klient miałby ponieść z tytułu Umowy sprzedaży. Wiadomość zawiera także informację dla Klienta, że zawarcie przez niego Umowy sprzedaży za pośrednictwem poczty elektronicznej pociąga za sobą obowiązek zapłaty za zamówiony Towar. Na podstawie podanych przez Sprzedawcę informacji, Klient może złożyć zamówienie, przesyłając wiadomość elektroniczną do Sprzedawcy wskazując wybraną formę płatności oraz sposób Dostawy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">11.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient ma możliwość złożenia zamówienia indywidualnego, w którym Towar zostanie wykonany według jego specyfikacji lub będzie służył zaspokojeniu jego zindywidualizowanych potrzeb. W tym celu, Klient kompletując wstępne zamówienie, może wybrać model Towaru, którym jest zainteresowany spośród przedstawionych przez Sprzedawcę na Stronie Internetowej Sklepu, określając jego właściwości lub nadając cechy ściśle związane z jego osobą, w szczególności: wymiary; rozstawy zamków; kolor. Klient po skompletowaniu wstępnego zamówienia składa Sprzedawcy zapytanie o wycenę przesyłając wiadomość elektroniczną na podany przez Sprzedawcę adres e-mail. Przez wysyłanie wiadomości elektronicznej do Sprzedawcy, Klient składa zapytanie o bezpłatną wycenę obejmującą wstępne zamówienie.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">12.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca po otrzymaniu wstępnego zamówienia przesyła do Klienta odpowiedź zgodnie ze wstępnym zamówieniem za pośrednictwem poczty elektronicznej, podając możliwe formy płatności oraz Dostawy oraz termin spełnienia świadczenia. Klient może zaakceptować przesłaną propozycję Sprzedawcy lub ją odrzucić poprzez wysłanie wiadomości drogą elektroniczną do Sprzedawcy wskazując wybrany sposób Dostawy oraz formę płatności. Klient składa w ten sposób zamówienie. Każdorazowo przed wysyłaniem zamówienia do Sprzedawcy podawana jest cena łączna wybranych Towarów, łączny koszt wybranego sposobu Dostawy oraz termin spełnienia świadczenia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">13.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Złożenie zamówienia stanowi złożenie Sprzedawcy przez Klienta oferty zawarcia Umowy sprzedaży Towarów będących przedmiotem zamówienia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">14.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Po złożeniu zamówienia, Sprzedawca przesyła na podany przez Klienta adres poczty elektronicznej potwierdzenie jego złożenia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">15.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Następnie, po potwierdzeniu złożenia zamówienia, Sprzedawca przesyła na podany przez Klienta adres poczty elektronicznej informację o przyjęciu zamówienia do realizacji. Informacja o przyjęciu zamówienia do realizacji jest oświadczeniem Sprzedawcy o przyjęciu oferty, o której mowa w §4 ust. 13 powyżej i z chwilą jego otrzymania przez Klienta zostaje zawarta Umowa sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">16.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Po zawarciu Umowy sprzedaży, Sprzedawca potwierdza Klientowi będącemu Konsumentem jej warunki, przesyłając je na Trwałym nośniku, na adres poczty elektronicznej Klienta lub pisemnie na wskazany przez Klienta podczas składania zamówienia adres.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 5 Płatności</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Ceny na Stronie Internetowej Sklepu zamieszczone przy danym Towarze stanowią ceny brutto i nie zawierają informacji odnośnie kosztów Dostawy i wszelkich innych kosztów, które Klient będzie zobowiązany ponieść w związku z Umową sprzedaży, o których Klient będzie poinformowany przy wyborze sposobu Dostawy i składaniu zamówienia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może wybrać następujące formy płatności za zamówione Towary:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">przelew bankowy na rachunek bankowy Sprzedawcy (w tym przypadku realizacja zamówienia rozpoczęta zostanie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia oraz po wpłynięciu środków na rachunek bankowy Sprzedawcy);</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">przelew bankowy na rachunek bankowy Sprzedawcy z opcją odbioru osobistego w biurze Sprzedawcy (w tym przypadku realizacja zamówienia zostanie rozpoczęta niezwłocznie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia, zaś Towar wydany zostanie w biurze Sprzedawcy, po wpłynięciu środków na rachunek bankowy Sprzedawcy);</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">c)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">karta płatnicza lub przelew bankowy poprzez zewnętrzny system płatności PayU, obsługiwany przez firmę PayU S.A. z siedzibą w Poznaniu (w tym przypadku realizacja zamówienia rozpoczęta zostanie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia oraz po otrzymaniu z systemu PayU informacji o pozytywnym zakończeniu przeprowadzonej płatności);</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">d)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">kartą płatniczą lub przelewem bankowym poprzez zewnętrzny system płatności PayU, z opcją odbioru osobistego w biurze Sprzedawcy, obsługiwany przez firmę PayU S.A. z siedzibą w Poznaniu (w tym przypadku realizacja zamówienia rozpoczęta zostanie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia oraz po otrzymaniu z systemu PayU informacji o pozytywnym zakończeniu przeprowadzonej płatności) zaś Towar wydany zostanie w biurze Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient powinien dokonać płatności za zamówienie w wysokości wynikającej z zawartej Umowy sprzedaży w terminie 7 Dni roboczych, jeżeli wybrał formę przedpłaty.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W wypadku niewywiązania się przez Klienta z płatności w terminie, o którym mowa w §5 ust. 3 Regulaminu, Sprzedawca wyznacza Klientowi dodatkowy termin na dokonanie płatności i informuje o nim Klienta na Trwałym nośniku. Informacja o dodatkowym terminie na dokonanie płatności zawiera również informację, że po bezskutecznym upływie tego terminu, Sprzedawca odstąpi od Umowy sprzedaży. W wypadku bezskutecznego upływu drugiego terminu na dokonanie płatności, Sprzedawca prześle Klientowi na Trwałym nośniku oświadczenie o odstąpieniu od umowy na podstawie art. 491 Kodeksu Cywilnego.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 6 Dostawa</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca realizuje Dostawę na terytorium Rzeczypospolitej Polskiej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca jest zobowiązany dostarczyć Towar zgodny z Umową sprzedaży.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca zamieszcza na Stronie Internetowej Sklepu lub w wiadomości e-mail, o której mowa w  informację o liczbie Dni roboczych potrzebnych do Dostawy i realizacji zamówienia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Termin Dostawy i realizacji zamówienia wskazany na Stronie Internetowej Sklepu liczony jest w Dniach roboczych zgodnie z §5 ust. 2 Regulaminu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Zamówione Towary są dostarczane do Klienta za pośrednictwem Dostawcy na adres wskazany w formularzu zamówienia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W dniu wysłania Towaru do Klienta (jeśli nie wybrano możliwości osobistego odbioru Towaru) przekazywana jest na adres poczty elektronicznej Klienta informacja potwierdzająca nadanie przesyłki przez Sprzedawcę.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient obowiązany jest zbadać doręczoną przesyłkę w czasie i w sposób przyjęty przy przesyłkach danego rodzaju. W razie stwierdzenia ubytku lub uszkodzenia przesyłki Klient ma prawo żądać od pracownika Dostawcy spisania właściwego protokołu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient ma możliwość odbioru osobistego zamówionego Towaru. Odbioru można dokonać w biurze Sprzedawcy w Dni Robocze, w godzinach otwarcia wskazanych na Stronie Internetowej Sklepu, po wcześniejszym ustaleniu ze Sprzedawcą terminu odbioru za pośrednictwem poczty elektronicznej lub telefonicznie.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca, zgodnie z wolą Klienta, dołącza do przesyłki będącej przedmiotem Dostawy paragon albo fakturę VAT obejmującą dostarczane Towary.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient w celu otrzymania faktury VAT powinien zadeklarować w momencie dokonywania zakupu, że nabywa Towar jako Przedsiębiorca (podatnik). Zgłoszenie powyższej deklaracji następuje poprzez oznaczenie odpowiedniego pola w formularzu zamówienia, przed wysłaniem zamówienia do Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W przypadku nieobecności Klienta pod wskazanym przez niego adresem, podanym przy składaniu zamówienia jako adres Dostawy, pracownik Dostawcy pozostawi awizo lub podejmie próbę kontaktu telefonicznego celem ustalenia terminu, w którym Klient będzie obecny. W przypadku zwrotnego odesłania zamówionego Towaru do Sklepu Internetowego przez Dostawcę, Sprzedawca skontaktuje się z Klientem drogą elektroniczną lub telefonicznie, ustalając ponownie z Klientem termin i koszt Dostawy.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 7 Rękojmia dla Przedsiębiorców</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca zapewnia Dostawę Towaru pozbawionego wad. Sprzedawca jest odpowiedzialny względem Przedsiębiorcy, jeżeli Towar ma wadę.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli Towar ma wadę, Przedsiębiorca może:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od Umowy sprzedaży, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Przedsiębiorcy wymieni Towar wadliwy na wolny od wad albo wadę usunie.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Ograniczenie to nie ma zastosowania, jeżeli Towar był już wymieniony lub naprawiany przez Sprzedawcę albo Sprzedawca nie uczynił zadość obowiązkowi wymiany Towaru na wolny od wad lub usunięcia wad. Przedsiębiorca może zamiast zaproponowanego przez Sprzedawcę usunięcia wady żądać wymiany Towaru na wolny od wad albo zamiast wymiany Towaru żądać usunięcia wady, chyba że doprowadzenie rzeczy do zgodności z umową w sposób wybrany przez Przedsiębiorcę jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę. Przy ocenie nadmierności kosztów uwzględnia się wartość Towaru wolnego od wad, rodzaj i znaczenie stwierdzonej wady, a także bierze się pod uwagę niedogodności, na jakie narażałby Przedsiębiorcę inny sposób zaspokojenia.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Przedsiębiorca nie może odstąpić od Umowy sprzedaży, jeżeli wada jest nieistotna.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">żądać wymiany Towaru wadliwego na wolny od wad albo usunięcia wady. Sprzedawca jest obowiązany wymienić Towar wadliwy na wolny od wad lub usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla Przedsiębiorcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca może odmówić zadośćuczynienia żądaniu Przedsiębiorcy, jeżeli doprowadzenie do zgodności z Umową sprzedaży Towaru wadliwego w sposób wybrany przez Przedsiębiorcę jest niemożliwe lub w porównaniu z drugim możliwym sposobem doprowadzenia do zgodności z Umową sprzedaży wymagałoby nadmiernych kosztów. Koszty naprawy lub wymiany ponosi Sprzedawca.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Przedsiębiorca, który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany dostarczyć rzecz wadliwą na adres Sprzedawcy. Koszt dostarczenia pokrywa Sprzedawca.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca odpowiada z tytułu rękojmi, jeżeli wada fizyczna zostanie stwierdzona przed upływem dwóch lat od wydania Towaru Przedsiębiorcy. Roszczenie o usunięcie wady lub wymianę Towaru na wolny od wad przedawnia się z upływem roku, lecz termin ten nie może zakończyć się przed upływem terminu określonego w zdaniu pierwszym. W tym terminie Przedsiębiorca może odstąpić od Umowy sprzedaży lub złożyć oświadczenie o obniżeniu ceny z powodu wady Towaru. Jeżeli Przedsiębiorca żądał wymiany Towaru na wolny od wad lub usunięcia wady, termin do odstąpienia od Umowy sprzedaży lub złożenia oświadczenia o obniżeniu ceny rozpoczyna się z chwilą bezskutecznego upływu terminu do wymiany Towaru, lub usunięcia wady</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Wszelkie reklamacje związane z Towarem lub realizacją Umowy sprzedaży, Przedsiębiorca może kierować w formie pisemnej na adres Sprzedawcy</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca w ciągu 14 dni od dnia żądania zawierającego reklamację, ustosunkuje się do reklamacji Towaru lub reklamacji związanej z realizacją Umowy sprzedaży zgłoszonej przez Przedsiębiorcę.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może zgłosić Sprzedawcy reklamację w związku z korzystaniem z usług nieodpłatnych świadczonych drogą elektroniczną przez Sprzedawcę. Reklamacja może być złożona w formie elektronicznej i przesłana na adres studioklamek@studioklamek.pl. W zgłoszeniu reklamacyjnym Przedsiębiorca winien zawrzeć opis zaistniałego problemu. Sprzedawca niezwłocznie, lecz nie później niż w terminie 14 dni rozpatruje reklamacje i udziela Przedsiębiorcy odpowiedzi.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 8 Niezgodność towaru z umową</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;font-weight:bold;\">Reklamacja Konsumenta oraz Przedsiębiorcy z uprawnieniami Konsumenta</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Towar jest zgodny z umową, jeżeli zgodne z umową pozostają w szczególności jego:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">opis, rodzaj, ilość, jakość, kompletność i funkcjonalność, a w odniesieniu do towarów z elementami cyfrowymi – również kompatybilność, interoperacyjność i dostępność aktualizacji;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">przydatność do szczególnego celu, do którego jest potrzebny Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta, o którym Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, powiadomił Sprzedawcę najpóźniej w chwili zawarcia umowy i który Sprzedawca zaakceptował.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Ponadto Towar, aby został uznany za zgodny z umową, musi:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">nadawać się do celów, do których zazwyczaj używa się Towaru tego rodzaju, z uwzględnieniem obowiązujących przepisów prawa, norm technicznych lub dobrych praktyk;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">występować w takiej ilości i mieć takie cechy, w tym Trwałość i bezpieczeństwo, a w odniesieniu do Towarów z elementami cyfrowymi – również funkcjonalność i kompatybilność, jakie są typowe dla Towaru tego rodzaju i których Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może rozsądnie oczekiwać, biorąc pod uwagę charakter Towaru oraz publiczne zapewnienie złożone przez Sprzedawcę, jego poprzedników prawnych lub osoby działające w ich imieniu, w szczególności w reklamie lub na etykiecie, chyba że Sprzedawca wykaże, że:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"4\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a.</td>\n<td colspan=\"6\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">nie wiedział o danym publicznym zapewnieniu i oceniając rozsądnie, nie mógł o nim wiedzieć;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"4\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b.</td>\n<td colspan=\"6\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">przed zawarciem umowy publicznej zapewnienie zostało sprostowane z zachowaniem warunków i formy, w jakich publiczne zapewnienie zostało złożone, lub w porównywalny sposób;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"4\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">c.</td>\n<td colspan=\"6\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">publiczne zapewnienie nie miało wpływu na decyzję Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta o zawarciu umowy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">c)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">być dostarczany z opakowaniem, akcesoriami i instrukcjami, których dostarczenia Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może rozsądnie oczekiwać;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">d)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">być takiej samej jakości jak próbka lub wzór, które Sprzedawca udostępnił Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta przed zawarciem umowy, i odpowiadać opisowi takiej próbki lub takiego wzoru.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca nie ponosi odpowiedzialności za brak zgodności Towaru z umową w zakresie, o którym mowa w §8 ust. 2, jeżeli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, najpóźniej w chwili zawarcia umowy, został wyraźnie poinformowany, że konkretna cecha Towaru odbiega od wymogów zgodności z umową określonych w §8 ust. 2, oraz wyraźnie i odrębnie zaakceptował brak konkretnej cechy Towaru.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca ponosi odpowiedzialność za brak zgodności Towaru z umową wynikający z niewłaściwego zamontowania Towaru, jeżeli:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">zostało ono przeprowadzone przez Sprzedawcę lub na jego odpowiedzialność;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">niewłaściwe zamontowanie przeprowadzone przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta wynikało z błędów w instrukcji dostarczonej przez przedsiębiorcę lub osobę trzecią.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca ponosi odpowiedzialność za brak zgodności Towaru z umową istniejący w chwili jego dostarczenia i ujawniony w ciągu dwóch lat od tej chwili, chyba że termin przydatności Towaru do użycia, określony przez Sprzedawcę, jego poprzedników prawnych lub osoby działające w ich imieniu, jest dłuższy. Domniemywa się, że brak zgodności Towaru z umową, który ujawnił się przed upływem dwóch lat od chwili dostarczenia towaru, istniał w chwili jego dostarczenia, o ile nie zostanie udowodnione inaczej lub domniemania tego nie można pogodzić ze specyfiką Towaru lub charakterem braku zgodności Towaru z umową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca nie może powoływać się na upływ terminu do stwierdzenia braku zgodności Towaru z umową określonego w §8 ust. 5, jeżeli brak ten podstępnie zataił.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli Towar jest niezgodny z umową, Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może żądać jego naprawy lub wymiany.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca może dokonać wymiany, gdy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta żąda naprawy, lub Sprzedawca może dokonać naprawy, gdy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta żąda wymiany, jeżeli doprowadzenie do zgodności Towaru z umową w sposób wybrany przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta jest niemożliwe albo wymagałoby nadmiernych kosztów dla Sprzedawcy. Jeżeli naprawa i wymiana są niemożliwe lub wymagałyby nadmiernych kosztów dla Sprzedawcy, może on odmówić doprowadzenia towaru do zgodności z umową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Przy ocenie nadmierności kosztów dla Sprzedawcy uwzględnia się wszelkie okoliczności sprawy, w szczególności znaczenie braku zgodności Towaru z umową, wartość Towaru zgodnego z umową oraz nadmierne niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta powstałe wskutek zmiany sposobu doprowadzenia Towaru do zgodności z umową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca dokonuje naprawy lub wymiany w rozsądnym czasie od chwili, w której Sprzedawca został poinformowany przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta o braku zgodności z umową, i bez nadmiernych niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta, uwzględniając specyfikę Towaru oraz cel, w jakim Konsument lub Przedsiębiorca z uprawnieniami Konsumenta go nabył. Koszty naprawy lub wymiany, w tym w szczególności koszty opłat pocztowych, przewozu, robocizny i materiałów, ponosi Sprzedawca.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">11.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument lub Przedsiębiorca z uprawnieniami Konsumenta udostępnia Sprzedawcy Towar podlegający naprawie lub wymianie. Sprzedawca odbiera od Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta Towar na swój koszt.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">12.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli Towar został zamontowany przed ujawnieniem się braku zgodności Towaru z umową, Sprzedawca demontuje towar oraz montuje go ponownie po dokonaniu naprawy lub wymiany albo zleca wykonanie tych czynności na swój koszt.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">13.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument lub Przedsiębiorca z uprawnieniami Konsumenta nie jest zobowiązany do zapłaty za zwykłe korzystanie z Towaru, który następnie został wymieniony.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">14.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli Towar jest niezgodny z umową Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od umowy, gdy:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca odmówił doprowadzenia Towaru do zgodności z umową zgodnie z §8 ust. 8 powyżej;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca nie doprowadził Towaru do zgodności z umową zgodnie z §8 ust. 10 do §8 ust. 12 powyżej;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">c)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">brak zgodności Towaru z umową występuje nadal, mimo że Sprzedawca próbował doprowadzić Towar do zgodności z umową;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">d)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">brak zgodności Towaru z umową jest na tyle istotny, że uzasadnia obniżenie ceny albo odstąpienie od umowy bez uprzedniego skorzystania ze środków ochrony określonych od §8 ust. 7 do §8 ust. 12 powyżej;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">e)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">z oświadczenia Sprzedawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on Towaru do zgodności z umową w rozsądnym czasie lub bez nadmiernych niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">15.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca jest obowiązany udzielić odpowiedzi na reklamację konsumenta w terminie 14 dni od dnia jej otrzymania.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">16.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca zwraca Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta, kwoty należne wskutek skorzystania z prawa obniżenia ceny niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta o obniżeniu ceny.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">17.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument lub Przedsiębiorca z uprawnieniami Konsumenta nie może odstąpić od umowy, jeżeli brak zgodności Towaru z umową jest nieistotny. Domniemywa się, że brak zgodności Towaru z umową jest istotny.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">18.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli brak zgodności z umową dotyczy jedynie niektórych Towarów dostarczonych na podstawie umowy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od umowy jedynie w odniesieniu do tych Towarów, a także w odniesieniu do innych Towarów nabytych przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta wraz z Towarami niezgodnymi z umową, jeżeli nie można rozsądnie oczekiwać, aby Konsument lub Przedsiębiorca z uprawnieniami Konsumenta zgodził się zatrzymać wyłącznie Towary zgodne z umową.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">19.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W razie odstąpienia od umowy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta niezwłocznie zwraca Towar Sprzedawcy na jego koszt. Sprzedawca zwraca Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta cenę niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania Towaru lub dowodu jego odesłania.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">20.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca dokonuje zwrotu ceny przy użyciu takiego samego sposobu zapłaty, jakiego użył Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, chyba że Konsument lub Przedsiębiorca z uprawnieniami Konsumenta wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">21.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca nie korzysta z pozasądowego rozwiązywania sporów, o których mowa w ustawie z dnia 23 września 2016 r. o pozasądowym rozwiązywaniu sporów konsumenckich.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 9 Odstąpienie od Umowy sprzedaży</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient będący Konsumentem oraz Przedsiębiorca z uprawnieniami Konsumenta, który zawarł Umowę sprzedaży, może w terminie 14 dni odstąpić od niej bez podawania przyczyny.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Bieg terminu na odstąpienie od Umowy sprzedaży rozpoczyna się od chwili objęcia Towaru w posiadanie przez Konsumenta, Przedsiębiorcę z uprawnieniami Konsumenta lub wskazaną przez nich osobę trzecią inną niż przewoźnik.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od Umowy sprzedaży składając Sprzedawcy oświadczenie o odstąpieniu. Oświadczenie to może zostać złożone przykładowo pisemnie na adres Sprzedawcy, tj.: Ewa Szymańczyk \" EUROPOL\" PRYWATNA FIRMA HANDLOWA, ul. Bartycka 24/26 pawilon 17 (00-716), Warszawa, lub też za pośrednictwem poczty elektronicznej na adres Sprzedawcy, tj.: studioklamek@studioklamek.pl. Oświadczenie można złożyć na formularzu, którego wzór został zamieszczony przez Sprzedawcę na Stronie Internetowej Sklepu pod adresem: Formularz odstąpienia. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od Umowy, składając Sprzedawcy oświadczenie o odstąpieniu za pośrednictwem formularza udostępnionego na stronie internetowej pod adresem: <u>Elektroniczny Formularz odstąpienia</u>. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Sprzedawca niezwłocznie potwierdza Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta otrzymanie formularza złożonego za pośrednictwem strony internetowej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W przypadku odstąpienia od Umowy sprzedaży jest ona uważana za niezawartą.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeśli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta złożył oświadczenie o odstąpieniu od Umowy sprzedaży, zanim Sprzedawca przyjął jego ofertę, oferta przestaje wiązać.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca ma obowiązek niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta o odstąpieniu od Umowy sprzedaży, zwrócić mu wszystkie dokonane przez niego płatności, w tym koszt Dostawy Towaru do Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta. Sprzedawca może wstrzymać się ze zwrotem płatności otrzymanych od Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta do chwili otrzymania z powrotem Towaru, lub dostarczenia przez Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta dowodu odesłania Towaru, w zależności od tego, które zdarzenie nastąpi wcześniej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeżeli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta korzystający z prawa do odstąpienia wybrał sposób dostarczenia Towaru inny niż najtańszy zwykły sposób Dostawy oferowany przez Sprzedawcę, Sprzedawca nie jest zobowiązany do zwrotu Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta poniesionych przez niego dodatkowych kosztów.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument lub Przedsiębiorca z uprawnieniami Konsumenta ma obowiązek zwrócić Towar Sprzedawcy niezwłocznie, jednak nie później niż w terminie 14 dni od dnia, w którym odstąpił od Umowy sprzedaży. Do zachowania terminu wystarczy odesłanie Towaru na adres Sprzedawcy przed upływem tego terminu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W wypadku odstąpienia Klient będący Konsumentem lub Przedsiębiorca z uprawnieniami Konsumenta ponosi tylko bezpośrednie koszty zwrotu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">11.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Jeśli ze względu na swój charakter Towar nie może zostać w zwykłym trybie odesłany pocztą, Sprzedawca informuje Konsumenta oraz Przedsiębiorcę z uprawnieniami Konsumenta o kosztach zwrotu rzeczy na Stronie Internetowej Sklepu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">12.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta ponosi odpowiedzialność za zmniejszenie wartości Towaru będące wynikiem korzystania z niego w sposób wykraczający poza sposób konieczny do stwierdzenia charakteru, cech i funkcjonowania Towaru.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">13.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu zapłaty, jakiego użył Konsument lub Przedsiębiorca z uprawnieniami Konsumenta chyba, że Konsument lub Przedsiębiorca z uprawnieniami Konsumenta wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">14.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Prawo odstąpienia od Umowy sprzedaży nie przysługuje Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta w odniesieniu do umów, w których Towarem jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji Konsumenta, Przedsiębiorcy z uprawnieniami Konsumenta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 10 Usługi nieodpłatne</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca świadczy na rzecz Klientów, drogą elektroniczną usługi nieodpłatne:</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">a)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Formularz kontaktowy;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">b)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Newsletter;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">c)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Prowadzenie Konta Klienta;</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"3\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">d)</td>\n<td colspan=\"7\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Zapytaj o produkt.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Usługi wskazane w §10 ust. 1 powyżej świadczone są 7 dni w tygodniu, 24 godziny na dobę.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca zastrzega sobie możliwość wyboru i zmiany rodzaju, form, czasu oraz sposobu udzielania dostępu do wybranych wymienionych usług, o czym poinformuje Klientów w sposób właściwy dla zmiany Regulaminu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Usługa Formularz kontaktowy polega na wysłaniu za pomocą formularza umieszczonego na Stronie Internetowej Sklepu wiadomości do Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Rezygnacja z usługi nieodpłatnej Formularz kontaktowy, możliwa jest w każdej chwili i polega na zaprzestaniu wysyłania zapytań do Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Z usługi Newsletter może skorzystać każdy Klient, który wprowadzi swój adres poczty elektronicznej, wykorzystując w tym celu formularz rejestracyjny udostępniony przez Sprzedawcę na Stronie Internetowej Sklepu. Po przesłaniu wypełnionego formularza rejestracyjnego, Klient otrzymuje niezwłocznie, drogą elektroniczną na adres poczty elektronicznej podany w formularzu rejestracyjnym link aktywacyjny, w celu potwierdzenia zapisania się na subskrypcję Newsletter. Z chwilą aktywacji linku przez Klienta zawarta zostaje umowa o świadczenie drogą elektroniczną usługi Newsletter.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\"></td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może dodatkowo podczas Rejestracji zaznaczyć odpowiednie pole w formularzu rejestracyjnym w celu subskrypcji usługi Newsletter.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">7.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Usługa Newsletter polega na przesyłaniu przez Sprzedawcę, na adres poczty elektronicznej, wiadomości w formie elektronicznej zawierającej informacje o nowych produktach lub usługach w ofercie Sprzedawcy. Newsletter przesyłany jest przez Sprzedawcę do wszystkich Klientów, którzy dokonali subskrypcji.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">8.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Każdy Newsletter kierowany do danych Klientów zawiera w szczególności: informację o nadawcy, wypełnione pole „temat”, określające treść przesyłki oraz informację o możliwości i sposobie rezygnacji z usługi nieodpłatnej Newsletter.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">9.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient może w każdej chwili zrezygnować z otrzymywania Newsletter’a przez wypisanie się z subskrypcji za pośrednictwem odnośnika zamieszczonego w każdej wiadomości elektronicznej wysłanej w ramach usługi Newsletter lub za pośrednictwem dezaktywacji odpowiedniego pola w Koncie Klienta.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">10.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Usługa Zapytaj o produkt, polega na wysłaniu za pomocą formularza umieszczonego na Stronie Internetowej Sklepu wiadomości do Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">11.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Rezygnacja z usługi nieodpłatnej Zapytaj o produkt, możliwa jest w każdej chwili i polega na zaprzestaniu wysyłania zapytań do Sprzedawcy.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">12.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Usługa Prowadzenie Konta Klienta dostępna jest po dokonaniu Rejestracji na zasadach opisanych w Regulaminie i polega na udostępnieniu Klientowi dedykowanego panelu w ramach Strony Internetowej Sklepu, umożliwiającego Klientowi modyfikacje danych, które podał podczas Rejestracji, jak też śledzenia stanu realizacji zamówień oraz historii zamówień już zrealizowanych.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">13.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient, który dokonał Rejestracji może zgłosić Sprzedawcy żądanie usunięcia Konta Klienta, przy czym w przypadku zgłoszenia żądania usunięcia Konta Klienta przez Sprzedawcę, może ono zostać usunięte do 14 dni od zgłoszenia żądania.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">14.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca jest uprawniony do zablokowania dostępu do Konta Klienta i usług nieodpłatnych, w przypadku działania przez Klienta na szkodę Sprzedawcy, tj. prowadzenia działalności reklamowej innego przedsiębiorcy lub produktu; działalności polegającej na zamieszczaniu treści nie związanych z działalnością Sprzedawcy; działalności polegającej na zamieszczaniu treści nieprawdziwych lub wprowadzających w błąd, jak również w przypadku działania przez Klienta na szkodę innych Klientów, naruszenia przez Klienta przepisów prawa lub postanowień Regulaminu, a także, gdy zablokowanie dostępu do Konta Klienta i usług nieodpłatnych jest uzasadnione względami bezpieczeństwa - w szczególności: przełamywaniem przez Klienta zabezpieczeń Strony Internetowej Sklepu lub innymi działaniami hakerskimi. Zablokowanie dostępu do Konta Klienta i usług nieodpłatnych z wymienionych przyczyn trwa przez okres niezbędny do rozwiązania kwestii stanowiącej podstawę zablokowania dostępu do Konta Klienta i usług nieodpłatnych. Sprzedawca zawiadamia Klienta o zablokowaniu dostępu do Konta Klienta i usług nieodpłatnych drogą elektroniczną na adres podany przez Klienta w formularzu rejestracyjnym.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 11 Ochrona danych osobowych</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Zasady ochrony Danych Osobowych zamieszczone są w Polityce prywatności.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 12 Rozwiązanie umowy (nie dotyczy Umów sprzedaży)</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Zarówno Klient, jak i Sprzedawca mogą rozwiązać umowę o świadczenie usług drogą elektroniczną w każdym czasie i bez podania przyczyn, z zastrzeżeniem zachowania praw nabytych przez drugą stronę przed rozwiązaniem ww. umowy oraz postanowień poniżej.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Klient, który dokonał Rejestracji, rozwiązuje umowę o świadczenie usług drogą elektroniczną poprzez wysłanie do Sprzedawcy stosownego oświadczenia woli, przy użyciu dowolnego środka komunikacji na odległość, umożliwiającego zapoznanie się Sprzedawcy z oświadczeniem woli Klienta.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca wypowiada umowę o świadczenie usług drogą elektroniczną poprzez wysłanie do Klienta stosownego oświadczenia woli na adres poczty elektronicznej podany przez Klienta podczas Rejestracji.</td>\n</tr>\n<tr style=\"border:0px;\">\n<td colspan=\"11\" style=\"text-align:center;border:0px;padding:25px 0px 5px;font-size:10pt;width:auto;vertical-align:top;margin:15px 0px;font-weight:bold;\"><span class=\"anchor\"></span>§ 13 Postanowienia końcowe</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">1.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca ponosi odpowiedzialność z tytułu niewykonania lub nienależytego wykonania umowy, lecz w przypadku umów zawieranych z Klientami będącymi Przedsiębiorcami Sprzedawca ponosi odpowiedzialność tylko w przypadku umyślnego wyrządzenia szkody i w granicach rzeczywiście poniesionych strat przez Klienta będącego Przedsiębiorcą.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">2.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Treść niniejszego Regulaminu może zostać utrwalona poprzez wydrukowanie, zapisanie na nośniku lub pobranie w każdej chwili ze Strony Internetowej Sklepu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">3.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">W przypadku powstania sporu na gruncie zawartej Umowy sprzedaży strony będą dążyły do rozwiązania sprawy polubownie. Prawem właściwym dla rozstrzygania wszelkich sporów powstałych na gruncie niniejszego Regulaminu jest prawo polskie.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">4.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Sprzedawca zastrzega sobie prawo zmiany niniejszego Regulaminu. Wszystkie zamówienia przyjęte przez Sprzedawcę do realizacji przed dniem wejścia w życie nowego Regulaminu są realizowane na podstawie Regulaminu, który obowiązywał w dniu składania zamówienia przez Klienta. Zmiana Regulaminu wchodzi w życie w terminie 7 dni od dnia opublikowania na Stronie Internetowej Sklepu. Sprzedawca poinformuje Klienta na 7 dni przed wejściem w życie nowego Regulaminu o zmianie Regulaminu za pomocą wiadomości przesłanej drogą elektroniczną zawierającej odnośnik do tekstu zmienionego Regulaminu. W razie, gdy Klient nie akceptuje nowej treści Regulaminu obowiązany jest zawiadomić o tym fakcie Sprzedawcę, co skutkuje rozwiązaniem umowy zgodnie z  postanowieniami §12 Regulaminu.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:30pt;vertical-align:top;\">5.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 3px 0px;font-size:10pt;width:auto;vertical-align:top;\">Umowy ze Sprzedawcą zawierane są w języku polskim.</td>\n</tr>\n<tr class=\"dokument-linia\" style=\"border:0px;\">\n<td colspan=\"2\" style=\"text-align:justify;border:0px;padding:3px 20px 24px 0px;font-size:10pt;width:auto;\"> </td>\n<td nowrap=\"nowrap\" style=\"text-align:justify;border:0px;padding:3px 20px 24px 0px;font-size:10pt;width:30pt;vertical-align:top;\">6.</td>\n<td colspan=\"8\" style=\"text-align:justify;border:0px;padding:3px 20px 24px 0px;font-size:10pt;width:auto;vertical-align:top;\">Regulamin wchodzi w życie z dniem 20.07.2025 r.</td>\n</tr>\n</tbody>\n</table>','regulamin'),(19,1,1,'Zwrot towaru - odstąpienie od umowy','','','','','zwrot-towaru-odstapienie-od-umowy'),(19,2,1,'Zwrot towaru - odstąpienie od umowy','','','','<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';\">Zwrot towaru jest możliwy tylko zgodnie z Regulaminem sklepu internetowego iklamki.pl, którego <span style=\"color:#4d5156;background:#ffffff;\">§ 8 Odstąpienie od Umowy sprzedaży dokładnie opisuje prostą procedurę zwrotu, w tym złożenie \"Oświadczenia o odstąpieniu od Umowy sprzedaży\".</span></span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"> </p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">Czas na zwrot: 14 dni.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">Adres wysyłki lub osobistego dostarczenia towaru:</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">Ewa Szymańczyk Europol Prywatna Firma Handlowa</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">ul. Bartycka 24/26 pawilon 17</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">00-716 Warszawa</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">tel. 509 440 936</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">e-mail: studioklamek@studioklamek.pl</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"> </p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">Zwrócony towar sprawdzimy w zakresie ilości, braku uszkodzeń oraz oznak używania, a zapłatę zwrócimy Państwu niezwłocznie za pomocą tej samej metody płatności, jak przy zakupie towaru.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"> </p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';color:#4d5156;background:#ffffff;\">Odstąpienie od Umowy sprzedaży może nastąpić bez podania przyczyny.</span></p>','zwrot-towaru-odstapienie-od-umowy'),(20,1,1,'Konserwacja klamek','','','','','konserwacja-klamek'),(20,2,1,'Konserwacja klamek','','','','<p class=\"MsoNormal\" style=\"margin:0px auto 6pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';background:#ffffff;\">1. Zalecamy przechowywanie produktów w suchym środowisku.</span><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';\"><br /><span style=\"background:#ffffff;\"><span>2. Przed przystąpieniem do montażu wszelkie prace związane z oczyszczeniem lub lakierowaniem drewna powinny być zakończone.</span></span><br /><span style=\"background:#ffffff;\"><span>3. Należy unikać kontaktu produktu z wszelkimi substancjami chemicznymi.</span></span><br /><span style=\"background:#ffffff;\"><span>4. Nie należy stosować środków chemicznych, twardych szczotek i szorstkich ściereczek do czyszczenia- mogą one uszkodzić powłokę produktu.</span></span><br /><span style=\"background:#ffffff;\"><span>5. Należy używać wyłącznie wilgotnej ściereczki, następnie osuszyć produkt suchą ściereczką.</span></span></span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 6pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"> </p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 6pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';background:#ffffff;\">Pielęgnacja okuć z mosiądzu naturalnego czyli nielakierowanego:</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 6pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';background:#ffffff;\">Wyroby z mosiądzu nielakierowanego śniedzieją, czyli pokrywają się ciemnym nalotem, który można łatwo usunąć.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';background:#ffffff;\">Na rynku dostępne są profesjonalne środki chemiczne do czyszczenia mosiądzu oraz istnieje wiele domowych sposobów.</span></p>\n<p style=\"margin:0px auto 1rem;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"></p>\n<p class=\"MsoNormal\" style=\"margin:0px auto 0.0001pt;font-size:18px;max-width:900px;line-height:26px;font-family:\'Exo 2\', sans-serif;text-align:justify;\"><span style=\"font-size:12pt;line-height:18.4px;font-family:Arial, \'sans-serif\';background:#ffffff;\">Zawsze należy zachować ostrożność i pamiętać o zabezpieczeniu powierzchni drzwi i mebli, bo środki do czyszczenia metali są żrące.</span></p>','konserwacja-klamek'),(23,1,1,'Zwroty produktów','','','','','zwroty-produktow'),(23,2,1,'Zwroty produktów','','','','<ul style=\"margin-bottom:0px;margin-top:0px;list-style:none;padding-left:0px;color:#232323;font-family:\'Exo 2\', sans-serif;font-size:13px;\">\n<li>Nie wykonałeś żadnych zwrotów produktów.</li>\n</ul>','zwroty-produktow');
